Inimigo1: .word 0x00008000 0x00FFFFFF 0x00FFFFFF 0x00FFFFFF 0x00008000 0x00FFFFFF 0x00FFFFFF 0x004100ff 0x00FFFFFF 0x00FFFFFF 0x00FFFFFF 0x004100ff 0x00FF0000 0x004100ff 0x00FFFFFF 0x00FFFFFF 0x00FFFFFF 0x004100ff 0x00FFFFFF 0x00FFFFFF 0x00008000 0x00FFFFFF 0x00FFFFFF 0x00FFFFFF 0x00008000                                                                      
.text

main: 	
	addi $22, $0, 5 #base
	addi $23, $0, 5 #altura
	mul $26 $22 $23 #area
	addi $26 $26 8192 #tamanho da tela
	addi $18, $0, 24 #x inicial
	addi $19, $0, 50 #y inicial
	addi $20, $0, 94 #x final
	addi $21, $0, 15 #y final
	
	add $27, $0, $18
	add $28, $0, $19
	
	#guardar o cenario e o personagem
	add $t2, $0, $26 #contador da iteracao
	add $t0 $0 $t2
	sll $t0 $t0 2
	addi $t0 $t0 0x10010000
	addi $t0 $t0 -4 #onde o bicho vai ler
	add $t8 $0 $t2
	sll $t8 $t8 2
	add $t8 $t8 $t0 #onde vai armazenar
	jal store
	
	#carrega cenario
	lui $t0, 0x1001 #onde vai escreve
	add $t8 $0 $26
	sll $t8 $t8 2
	add $t8 $t8 $t0 #onde vai ler
	addi $t2, $0, 0
	jal load
	
	add $18, $0, $18 #x inicial
	add $19, $0, $19 #y inicial
	add $20, $0, $20 #x final
	add $21, $0, $21 #y final
	add $22, $0, $22 #base
	add $23, $0, $23 #altura
	
# laco do persongaem pra ele fica perambulando
animacao1:
	beq  $18, $20, fimanimacao1# comparar posicao
	
        #carrega o inimigo
	addi $8 $0 8192# endereo da posicao inicial do inimigo
	sll $8 $8 3# 2 telas * 4 bits
	mul $17 $22 $23# linhas e colunas
	sll $17 $17 2 
	add $8 $8 $17
	addi $8 $8 0x10010000 
	add $9, $0, $22# coluna do desenho
	add $10, $0, $23# linha do desenho
	add $11, $0, $18# x
	add $12, $0, $19 #y
	jal personagem
	
	addi $8, $0, 15000# velocidade pra ir
	jal timer

		
	add $9, $0, $22 #colunas do desenho
	add $10, $0, $23 #linhas do desenho
	add $11, $0, $18 #x do comeo
	add $12, $0, $19 #y do do comeo
	jal carregafundo
	
	addi $18, $18, 1 #como o movimento vai comear (indo)
	j animacao1

fimanimacao1:

	animacao2:
	beq  $18, $27, fimanimacao2 #comparar posicao
	
        #carregar personagem (voltando)
	addi $8 $0 8192 #endereco da posicao inicial do imimigo
	sll $8 $8 3 #2 telas * 4 bits
	mul $17 $22 $23 #linhas e colunas
	sll $17 $17 2 
	add $8 $8 $17
	addi $8 $8 0x10010000 
	add $9, $0, $22 #colunas do desenho
	add $10, $0, $23 #linhas do desenho
	add $11, $0, $18 #x
	add $12, $0, $19 #y
	jal personagem
	
	addi $8, $0, 15000 #velocidade pra voltar
	jal timer

		
	add $9, $0, $22 #colunas do desenho
	add $10, $0, $23 #linhas do desenho
	add $11, $0, $18 #x do comeo
	add $12, $0, $19 #y do comeo
	jal carregafundo
	
	addi $18, $18, -1 #velocidade da volta
	j animacao2

fimanimacao2:

	j animacao1
end:	addi $2, $0, 10
	syscall
	
#carregar cenario
load:	lw $t1, 0($t8)
	sw $t1, 0($t0)
	addi $t0, $t0, 4
	addi $t8, $t8, 4
	addi $t2, $t2, 1
	bne $t2, 8192, load
	jr $31
	
#guarda o personagem e o cenario	
store:	lw $t1, 0($t0)
	sw $t1, 0($t8)
	addi $t0, $t0, -4
	addi $t8, $t8, -4
	addi $t2, $t2, -1
	bne $t2, 0, store
	jr $31


#desenhar inimigo
personagem:  
            lui $15, 0x1001
	    sll $11, $11, 2
            sll $12, $12, 9 
            add $15, $15, $11
            add $15, $15, $12 #posicao do comeco
            add $13, $0, $9 #largura 

laco1:	beq $10, $0, fimlaco1
laco2:	beq $9, $0, fimlaco2
	lw $14, 0($8) #onde vai ler
	sw $14, 0($15) #onde vai desenhar.
	addi $8, $8, 4
	addi $15, $15, 4
	addi $9, $9, -1 #largura
	j laco2
fimlaco2:    
	addi $15, $15, 512
	sll $16, $13, 2 
	sub $15, $15, $16
	add $9, $0, $13 #valor do comeo da largura
	addi $10, $10, -1 #altura
	j laco1  
fimlaco1: 
            jr $31
# carregar parte do cenario
carregafundo:  
            lui $15, 0x1001
	    sll $11, $11, 2
            sll $12, $12, 9 
            add $15, $15, $11
            add $15, $15, $12 #onde vai comecar a desenhar
            add $13, $0, $9 #largura 
            
            lui $8, 0x1001 
            add $8, $8, $11
            add $8, $8, $12 #onde via comecar a desenhar
	    add $12, $0, $26
	    sll $12, $12, 2
	    add $8, $8, $12
	    
laco1.1:	beq $10, $0, fimlaco1.1
laco2.1:	beq $9, $0, fimlaco2.1
	lw $14, 0($8) #onde vai ler
	sw $14, 0($15) #onde vai desenhar
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 #largura
	j laco2.1
fimlaco2.1:    
	addi $15, $15, 512
	addi $8, $8, 512
	sll $16, $13, 2 
	sub $8, $8, $16
	sub $15, $15, $16
	add $9, $0, $13 #valor do comeco da largura
	addi $10, $10, -1 #altura
	j laco1.1  
fimlaco1.1: 
            jr $31
	
#timer       
timer:	
	beq $8, $0, fimtimer
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	addi $8, $8, -1
	j timer
	
fimtimer: 
	  jr $31